function SignupPage(props) {
  const [plantnumber, setPlantnumber] = useState(""); //ÌôîÎ∂ÑÎ≤àÌò∏ state
  const navigate = useNavigate();
  const [nickname, setNickname] = useState("");

  // Í∞ÄÏûÖÌïòÍ∏∞ Î≤ÑÌäº ÎàÑÎ•¥Î©¥ ÏãúÌñâÎêòÎäî Ìï®Ïàò
  const start = () => {
    // ÌôîÎ∂ÑÎ≤àÌò∏Í∞Ä ÏóÜÏúºÎ©¥
    if (!plantnumber) {
      alert("ÌôîÎ∂ÑÎ≤àÌò∏Î•º ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.");
    } else if (!plantnumber == 8) {
      alert("ÌôîÎ∂ÑÎ≤àÌò∏Îäî 8ÏûêÎ¶¨ ÏûÖÎãàÎã§.");
    } else if (!/^[A-Z]{4}[0-9]{4}$/.test(plantnumber)) {
      alert("ÌôîÎ∂ÑÎ≤àÌò∏ ÏñëÏãùÏùÑ ÏßÄÏºúÏ£ºÏÑ∏Ïöî.");
    } // ÌôîÎ∂ÑÎ≤àÌò∏Í∞Ä ÏûàÏúºÎ©¥
    else {
      //Î°úÏª¨ Ïä§ÌÜ†Î¶¨ÏßÄÏóê Îç∞Ïù¥ÌÑ∞ Ï†ÄÏû• (ÏôºÏ™Ω: ÌÇ§, Ïò§Î•∏Ï™Ω: Îç∞Ïù¥ÌÑ∞)
      localStorage.setItem("flower_pot", plantnumber);
      localStorage.setItem("nickname", nickname);

      //Î∞±Ïóê Î≥¥ÎÇº data Ï†ïÏùò
      const data = {
        korean_name: localStorage.getItem("korean_name"),
        password: localStorage.getItem("password"),
        username: localStorage.getItem("username"),
        profile_picture: localStorage.getItem("profile_picture"),
        flower_pot: localStorage.getItem("flower_pot"),
        nickname: localStorage.getItem("nickname"),
      };
      console.log(data); // data ÏñëÏãù ÌôïÏù∏
      // Î∞±Ïóê ÌöåÏõêÍ∞ÄÏûÖ Îç∞Ïù¥ÌÑ∞ Î≥¥ÎÇ¥Îäî Î∂ÄÎ∂Ñ !!URL Ï∂îÍ∞ÄÌï¥Ïïº Ìï®.
      fetch("http://127.0.0.1:8000/api/signup/", {
        method: "POST",
        headers: {
          // headersÎäî HTTP ÏöîÏ≤≠ Ìó§ÎçîÎ•º ÏÑ§Ï†ï. Ìó§ÎçîÎäî ÌÅ¥ÎùºÏù¥Ïñ∏Ìä∏ÏôÄ ÏÑúÎ≤Ñ Í∞ÑÏùò ÌÜµÏã†ÏóêÏÑú Ï∂îÍ∞ÄÏ†ÅÏù∏ Ï†ïÎ≥¥Î•º Ï†ÑÎã¨ÌïòÍ∏∞ ÏúÑÌï¥ ÏÇ¨Ïö©.
          "Content-Type": "application/json", // Î≥∏Î¨∏Ïóê Ìè¨Ìï®Îêú Îç∞Ïù¥ÌÑ∞Í∞Ä JSONÌòïÏãùÏúºÎ°ú Ï†ÑÎã¨Îê®ÏùÑ ÎÇòÌÉÄÎÉÑ
        },
        body: JSON.stringify(data), // Î≥¥ÎÇº Îç∞Ïù¥ÌÑ∞ jsonÏúºÎ°ú Î≥ÄÌòï
        mode: "cors", // Î≥¥Ïïà ÎïåÎ¨∏Ïóê Î∂ôÏù¥Í∏∞!!
      })
        // Ï§ëÎ≥µÌïòÎäî Ï†ÑÌôîÎ≤àÌò∏ ÏûàÏùÑ Îïå ÌöåÏõêÍ∞ÄÏûÖ ÏïàÎêòÎèÑÎ°ù ÌïòÎäî Î°úÏßÅ Ï∂îÍ∞Ä ÌïÑÏöî
        .then((response) => {
          //ÏÑ±Í≥µÏ†ÅÏúºÎ°ú Î∞±Ïóê Îç∞Ïù¥ÌÑ∞ Î≥¥ÎÉàÏùÑ Îïå
          if (response.ok) {
            response.json().then((data) => {
              if (data.token && data.token.access) {
                alert(data.message); // ÌöåÏõêÍ∞ÄÏûÖ ÏÑ±Í≥µ
                navigate("/api/login");
              } else {
                throw new Error("ÌöåÏõêÍ∞ÄÏûÖÏóê Ïã§Ìå®ÌïòÏÖ®ÏäµÎãàÎã§."); //ÌöåÏõêÍ∞ÄÏûÖ Ïã§Ìå®
              }
            });
          }
          // Îç∞Ïù¥ÌÑ∞ Î≥¥ÎÇ¥Í∏∞ Ïã§Ìå®ÌñàÏùÑ Îïå
          else {
            throw new Error("Îç∞Ïù¥ÌÑ∞Î•º Î∞±ÏóîÎìúÎ°ú Î≥¥ÎÇ¥ÎäîÎç∞ Ïã§Ìå®ÌñàÏäµÎãàÎã§.");
          }
        })
        .catch((error) => {
          console.error(error);
          alert("Ï£ÑÏÜ°Ìï©ÎãàÎã§. ÌöåÏõêÍ∞ÄÏûÖÏùÑ Îã§Ïãú Ìï¥Ï£ºÏÑ∏Ïöî.");
          navigate("/signupstep1");
        });
    }
  };

  return (
    <div>
      <AccountNav text1="Í≥ÑÏ†ïÎßåÎì§Í∏∞" text2="Î°úÍ∑∏Ïù∏" link1="/api/login/" />
      <p style={ptag1}>ÌôîÎ∂Ñ ÌïòÎã®Ïùò Î≤àÌò∏Î•º ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.</p>
      {/* plantnumber ÏûëÏÑ± input */}
      <Input2
        type="text"
        value={plantnumber}
        onChange={(e) => setPlantnumber(e.target.value)}
        placeholder="ÌôîÎ∂Ñ Î≤àÌò∏"
      />
      <p style={ptag2}>ü™¥ ÏïÑÏßÅ ÌôîÎ∂ÑÏù¥ ÏóÜÏñ¥Ïöî. ü™¥</p>
      <BigBtn onClick={start} text="ÏãúÏûëÌïòÍ∏∞" />
    </div>
  );
}

